import React from 'react';
import Toolbar from './components/Toolbar';
import QuestionsList from './components/QuestionsList';
import './Home.css';

function Home() {
    return(
        <div className="dark-background">
            <Toolbar />

            <div id="spacer-div" style={{height: "50px"}}></div>

            <QuestionsList />
        </div>
    )
}

export default Home;
